class UserDataComponent {
    constructor(dataService, authService, route, afs) {
        this.dataService = dataService;
        this.authService = authService;
        this.route = route;
        this.afs = afs;
        this.photoURL = '';
        this.edit = false;
        this.editJob = false;
        this.profileOwner = false; // True if profileViewer is profileOwner
        this.config = {
            toolbar: [
                ['bold', 'italic', 'underline', 'size'],
                ['blockquote', 'code-block', 'link'],
            ]
        };
        const id = route.snapshot.params.user;
    }
    editToggle() {
        this.edit = !this.edit;
    }
    editToggleJob() {
        this.editJob = !this.editJob;
    }
    saveDataJob() {
        if (this.editJob) {
            this.editJob = !this.editJob;
        }
        this.authService.afs.collection('users').doc(this.authService.userData.uid).update({
            job: this.job
        });
    }
    saveSkill() {
        if (this.edit) {
            this.edit = !this.edit;
        }
        this.updateSkillsFirebase();
    }
    updateSkillArray(params) {
        this.skills = params;
    }
    updateSkillsFirebase() {
        this.authService.afs.collection('users').doc(this.authService.userData.uid).update({
            skills: [] = this.skills
        }).then(r => { });
    }
    ngOnInit() {
        this.sub = this.route.params.subscribe(params => {
            this.searchedUserId = params.user;
            this.authService.afs.collection('users').doc(this.searchedUserId).valueChanges().subscribe((val) => {
                console.log(val);
                this.job = val.job;
                this.description = val.description;
                this.skills = val.skills;
                this.firstname = val.firstname;
                this.lastname = val.lastname;
                this.photoURL = val.photoURL;
                this.displayName = val.displayName;
                this.email = val.email;
            });
        });
        this.htmlSkillElements = document.getElementsByClassName('skillDeleteButton');
        this.dataService.getCurrentUser().subscribe(user => {
            this.user = user;
            if (this.searchedUserId === this.user.uid) {
                this.profileOwner = true;
            }
            if (this.searchedUser) {
                this.user = this.searchedUser;
            }
        });
    }
    ngOnDestroy() {
        this.sub.unsubscribe();
    }
}
